// React //
import React from 'react';
import ReactDOM from 'react-dom';

// Redux //
import { Provider } from 'react-redux';
import { initStore } from './redux/store';

// React Router //
import { BrowserRouter, Route } from 'react-router-dom';

// Components //
import { homepage } from '../package.json';
import App from './components/App';
import Script from 'react-load-script'
// Styles //
import CalciteThemeProvider from 'calcite-react/CalciteThemeProvider';
import { GlobalStyle } from './styles/global';
import './styles/fonts.css';

// App runs at the root locally, but under /{homepage} in production
let basename;
process.env.NODE_ENV !== 'production' ? (basename = '') : (basename = homepage);

// Create Redux Store
export const store = initStore();

// App entry point
ReactDOM.render(
  <Provider store={store}>
   <Script url="https://cdnjs.cloudflare.com/ajax/libs/ol3/4.1.0/ol.js"></Script>
    <Script url="https://streetsmart.cyclomedia.com/api/v19.40/StreetSmartApi.js"></Script>
    <BrowserRouter basename={basename}>
      <CalciteThemeProvider>
        <GlobalStyle />
        <Route path='/' component={App} />
      </CalciteThemeProvider>
    </BrowserRouter>
  </Provider>,
  document.getElementById('root')
)
